import { useEffect, useState } from "react";

export default function App() {
  const [commissionData, setCommissionData] = useState([]);
  const [violationData, setViolationData] = useState([]);

  useEffect(() => {
    // Fetch commission data
    fetch('https://script.google.com/macros/s/AKfycbzSjgMyzv1ciX5MeW_f5Doh9gWydDGpN2Txz8gUSdf1nNq8TpxWlyyGFvJCbG-QwJM4/exec')
      .then(res => res.json())
      .then(data => setCommissionData(data))
      .catch(err => console.error('Commission Fetch Error:', err));

    // Fetch violations/AR data
    fetch('https://script.google.com/macros/s/AKfycbw5FIPX_XqlxHqwEuZZqugW0cwNG1zk2SI28q8ri0cm7XDDEkZ1ncgUk5v6ZMGrvpJp/exec')
      .then(res => res.json())
      .then(data => setViolationData(data))
      .catch(err => console.error('Violation Fetch Error:', err));
  }, []);

  return (
    <div>
      <h1>Live Dashboard</h1>

      <h2>Commission Data</h2>
      <pre>{JSON.stringify(commissionData, null, 2)}</pre>

      <h2>Scanning Violations & AR Data</h2>
      <pre>{JSON.stringify(violationData, null, 2)}</pre>
    </div>
  );
}
